import React from 'react';

const SearchResults = () => {

    if (!results.length) {
        return <p>No results</p>
      } else {
          return (
            <>
                {results.map((image) => (
                <img className="stock-image" alt="space-image" src={image} />
                ))}
            </>
          );
        }

    return (
        <>
            <p>Search Results</p>
            <img className="card-image" 
            src="img: https://images.unsplash.com/photo-1522030299830-16b8d3d049fe?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&w=1000&q=80/"
            alt="unsplash"/>
        </>
    )
}

export default SearchResults;
